import {
  Radar,
  RadarChart,
  Legend,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  ResponsiveContainer,
} from "recharts";
import styled from "styled-components";

const data = [
  { attr: "OFF", A: 120 },
  { attr: "AST", A: 98 },
  { attr: "TCK", A: 86 },
  { attr: "TRY", A: 99 },
  { attr: "PAS", A: 85 },
  { attr: "DEF", A: 65 },
];

const StyledStats = styled.div`
  .text {
    text-transform: uppercase;
    font-family: Montserrat, sans-serif;
  }
`;

interface Props {}

const PlayerStats = ({}: Props) => {
  return (
    <StyledStats>
      <ResponsiveContainer width="100%" height="100%">
        <RadarChart
          cx="50%"
          cy="50%"
          outerRadius={120}
          width={400}
          height={400}
          data={data}
        >
          <PolarGrid />
          <PolarAngleAxis
            dataKey="attr"
            tick={{ fill: "white", fontSize: 5 }}
          />
          <Radar
            name="Mike"
            dataKey="A"
            stroke="#ffdc11"
            fill="#ffdc11"
            fillOpacity={0.9}
          />
        </RadarChart>
      </ResponsiveContainer>
      {/* <RadarChart cx="50%" cy="50%" outerRadius="80%" data={data}> */}
      <RadarChart
        cx="50%"
        cy="50%"
        outerRadius={120}
        width={400}
        height={400}
        data={data}
      >
        <PolarGrid />
        <PolarAngleAxis dataKey="attr" tick={{ fill: "white" }} />
        <Radar
          name="Mike"
          dataKey="A"
          stroke="#ffdc11"
          fill="#ffdc11"
          fillOpacity={0.9}
        />
      </RadarChart>
    </StyledStats>
  );
};

export default PlayerStats;
